import React from 'react';
import ReactDOM from 'react-dom';
import cakes from './data';
import Cake from './Cake';

function CakeLiist() {


  return (

    <div className="row">
  { cakes.map((each,index) => {

    return ( <Cake data={each} key={index} />  )
  })}
</div>
  );

}

export default CakeLiist;
